        {
            string javascript = chart.GetInlineJS();
            int beginningIndex = javascript.IndexOf("var data = ") + "var data = ".Length;
            int lastIndex = javascript.LastIndexOf(";");

            int secondToLastSemiColonIndex = javascript.LastIndexOf(";", lastIndex - 1);
            int thirdToLastSemiColonIndex = javascript.LastIndexOf(";", secondToLastSemiColonIndex - 1);

            int layoutStartIndex = javascript.IndexOf("var layout = ", thirdToLastSemiColonIndex) + "var layout = ".Length;

            string json = "{"
                + @" ""data"":" + javascript.Substring(beginningIndex, thirdToLastSemiColonIndex - beginningIndex)
                + ", "
                + @" ""layout"":" + javascript.Substring(layoutStartIndex, secondToLastSemiColonIndex - layoutStartIndex)
                + "}";

            return JObject.Parse(json);
        }

        private static string GetChartHtml(PlotlyChart chart)
        {
            //chart.
            StringBuilder builder = new StringBuilder();

            builder.Append(@"
<script type=""text/javascript"">
require.config({
    paths: {
        Plotly: 'https://cdn.plot.ly/plotly-latest.min'
    }
});
</script>
");
            builder.Append(chart.GetInlineHtml());

            return builder.ToString();
        }

        private static string GetPlotlyJS()
        {
            const string prePlotlyInclude = @"
<script type=""text/javascript"">
var require_save = require;
var requirejs_save = requirejs;
var define_save = define;
var MathJax_save = MathJax;
MathJax = require = requirejs = define = undefined;
";

            const string postPlotlyInclude = @"
require = require_save;
requirejs = requirejs_save;
define = define_save;
MathJax = MathJax_save;
function ifsharpMakeImage(gd, fmt)
{
    return Plotly.toImage(gd, { format: fmt})
        .then(function(url) {
                var img = document.createElement('img');
                img.setAttribute('src', url);
                var div = document.createElement('div');
                div.appendChild(img);
                gd.parentNode.replaceChild(div, gd);
            });
        }
        function ifsharpMakePng(gd)
        {
            var fmt =
                (document.documentMode || / Edge /.test(navigator.userAgent)) ?
                    'svg' : 'png';
            return ifsharpMakeImage(gd, fmt);
        }
        function ifsharpMakeSvg(gd)
        {
            return ifsharpMakeImage(gd, 'svg');
        }
</script>
";
            StringBuilder js = new StringBuilder();
            string plotlyjs;
            using (Stream stream = typeof(XPlotKernelExtension).Assembly.GetManifestResourceStream("Microsoft.DotNet.Interactive.XPlot.plotly-latest.min.js"))
            using (StreamReader reader = new StreamReader(stream))
            {
                plotlyjs = reader.ReadToEnd();
            }

            js.Append(prePlotlyInclude);
            js.Append(plotlyjs);
            js.Append(postPlotlyInclude);

            return js.ToString();
        }
    }
